"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[1535],{1535:e=>{e.exports=JSON.parse('{"lessonId":"A2_U55","title":"\u0423\u0440\u043e\u043a 55: \u0413\u043b\u0430\u0433\u043e\u043b\u044b \u0442\u0438\u043f\u0430 GUSTAR","level":"A2","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0421\u043f\u0440\u044f\u0436\u0435\u043d\u0438\u0435 \u0433\u043b\u0430\u0433\u043e\u043b\u0430 GUSTAR","content":[{"text":"\u0413\u043b\u0430\u0433\u043e\u043b\u044b \u0442\u0438\u043f\u0430 `gustar`, `encantar` \u0438 \u0434\u0440. \u0441\u043f\u0440\u044f\u0433\u0430\u044e\u0442\u0441\u044f \u0438\u043d\u0430\u0447\u0435. \u041c\u0435\u0441\u0442\u043e\u0438\u043c\u0435\u043d\u0438\u0435 \u0443\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442, \u043a\u0442\u043e \u0438\u0441\u043f\u044b\u0442\u044b\u0432\u0430\u0435\u0442 \u0447\u0443\u0432\u0441\u0442\u0432\u043e, \u0430 \u0444\u043e\u0440\u043c\u0430 \u0433\u043b\u0430\u0433\u043e\u043b\u0430 \u0437\u0430\u0432\u0438\u0441\u0438\u0442 \u043e\u0442 \u0442\u043e\u0433\u043e, \u0447\u0442\u043e \u044d\u0442\u043e \u0447\u0443\u0432\u0441\u0442\u0432\u043e \u0432\u044b\u0437\u044b\u0432\u0430\u0435\u0442."},{"table":{"headers":[],"rows":[["(a m\xed)","me"],["(a ti)","te"],["(a usted)","le"],["(a \xe9l, a ella)","le"],["(a nosotros, -as)","nos"],["(a vosotros, -as)","os"],["(a ustedes)","les"],["(a ellos, -as)","les"]]}},{"list":["<i>\xbfTe <strong>gusta</strong> este traje?</i>","<i>Nos <strong>gustan</strong> la paella y el marisco.</i>","<i>\xbfOs <strong>gustan</strong> las naranjas?</i>","<i>A Ricardo no le <strong>gusta</strong> nada estudiar.</i>"]},{"text":"<strong>ATENCI\xd3N: me, te... gusta + infinitivo.</strong><br><i>Me <strong>gusta</strong> bailar. \u2192 A Concha le <strong>gusta</strong> cantar y bailar.<br>A Luis le <strong>gustan</strong> nadar y jugar al tenis. \u2192 A Luis le <strong>gusta</strong> nadar y jugar al tenis.</i>"},{"text":"<strong>a + nombre/nombre propio:</strong><br><i>A mis padres les <strong>gusta</strong> mucho viajar. \u2192 A Elsa no le <strong>gusta</strong> cocinar.</i>"}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0414\u0440\u0443\u0433\u0438\u0435 \u0433\u043b\u0430\u0433\u043e\u043b\u044b \u0441 \u0442\u0430\u043a\u043e\u0439 \u0436\u0435 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0435\u0439","content":[{"text":"<strong>`apetecer, doler, importar, interesar, quedar` (\u0441 \u0442\u0435\u043c\u0438 \u0436\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f\u043c\u0438, \u0447\u0442\u043e \u0438 `tener` \u0438\u043b\u0438 `sentar`)</strong>"},{"list":["<i>\xbfTe <strong>sientan</strong> bien estos pendientes?</i>","<i>A Luisa le <strong>duelen</strong> las muelas.</i>","<i>Solo nos <strong>quedan</strong> veinte euros.</i>","<i>No me <strong>importa</strong> madrugar.</i>","<i>\xbfTe <strong>interesan</strong> las matem\xe1ticas?</i>"]},{"text":"<strong>\u041a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u044f `a m\xed, a ti...` \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f:</strong><br>- \u0434\u043b\u044f \u044d\u043c\u0444\u0430\u0437\u044b: <i><strong>A nosotros</strong> nos encanta la \xf3pera.</i><br>- \u0434\u043b\u044f \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u044f \u043a\u043e\u043d\u0442\u0440\u0430\u0441\u0442\u0430: <i>\u2013Me encanta el f\xfatbol. \u2013<strong>A m\xed</strong> no me gusta nada.</i><br>- \u0447\u0442\u043e\u0431\u044b \u043f\u0440\u043e\u044f\u0441\u043d\u0438\u0442\u044c, \u043e \u043a\u043e\u043c \u0438\u0434\u0435\u0442 \u0440\u0435\u0447\u044c: <i><strong>A Pedro</strong> le gusta Luisa, pero <strong>a ella</strong> no le gusta Pedro.</i>"}]},{"type":"TheoryBlock","title":"\u041f\u0440\u0438\u043c\u0435\u0447\u0430\u043d\u0438\u0435: \u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 55.1","content":[{"text":"<strong>\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 55.1 \u043f\u0440\u043e\u043f\u0443\u0449\u0435\u043d\u043e, \u0442\u0430\u043a \u043a\u0430\u043a \u043e\u043d\u043e \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043e \u043d\u0430 \u0430\u043d\u0430\u043b\u0438\u0437\u0435 \u0442\u0430\u0431\u043b\u0438\u0446\u044b \u0441 \u0438\u043a\u043e\u043d\u043a\u0430\u043c\u0438.</strong>"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 55.2: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 gustar \u0438\u043b\u0438 encantar","tasks":[{"id":"u55_2_1","sentence":"1. \u2013Te ___ (gusta) bailar, Sara? \u2013S\xed, me ___ (encanta). \xbfY a ti? \u2013A m\xed no ___ (gusta).","answer":"gusta, encanta, me gusta"},{"id":"u55_2_2","sentence":"2. \u2013\xbf___ (gusta) leer a Rub\xe9n y a ti? \u2013A m\xed ___ (encanta), pero ___.","answer":"Os gusta, me encanta, a \xe9l no le gusta"},{"id":"u55_2_3","sentence":"3. A Nacho ___ (gusta) mucho ___ (encanta) Cristina, pero a Cristina ___ (gusta) Nacho.","answer":"le gusta, le encanta, no le gusta"},{"id":"u55_2_4","sentence":"4. \u2013\xbf___ (gusta) viajar, Manuel? \u2013S\xed, mucho. \xbfY a vosotras? \u2013___ (encanta).","answer":"Te gusta, Nos encanta"},{"id":"u55_2_5","sentence":"5. \u2013\xbfQu\xe9 ___ (gusta) hacer en vacaciones? \u2013___ (encanta) ir a la playa y descansar.","answer":"os gusta, Nos encanta"},{"id":"u55_2_6","sentence":"6. \u2013___ (gusta) hacer deporte. \xbfY a ti, Norma? \u2013___ (encanta) pasear y nadar.","answer":"Me gusta, Me encanta"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 55.3: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 apeter, doler, importar, interesar, quedar, sentar","tasks":[{"id":"u55_3_1","sentence":"1. A mi abuela le ___ mucho las piernas.","answer":"duelen"},{"id":"u55_3_2","sentence":"2. \u2013\xbf___ salir esta noche, Luis? \u2013No, estoy cansado.","answer":"Te apetece"},{"id":"u55_3_3","sentence":"3. A Elena y a ti ___ muy bien el color verde.","answer":"os sienta"},{"id":"u55_3_4","sentence":"4. \u2013\xbf(a vosotros) ___ mucho dinero? \u2013A m\xed solo ___ un peso.","answer":"Os queda, me queda"},{"id":"u55_3_5","sentence":"5. Tengo que ir al dentista. ___ las muelas.","answer":"Me duelen"},{"id":"u55_3_6","sentence":"6. A Jos\xe9 y a m\xed no ___ madrugar.","answer":"nos importa"},{"id":"u55_3_7","sentence":"7. \u2013\xbf___ a ustedes comer algo? \u2013No, gracias. No tenemos hambre.","answer":"Les apetece"},{"id":"u55_3_8","sentence":"8. A Jordi y a Gonzalo ___ bien la corbata.","answer":"les queda"},{"id":"u55_3_9","sentence":"9. La inform\xe1tica es muy \xfatil, pero a m\xed no ___ nada.","answer":"me interesa"},{"id":"u55_3_10","sentence":"10. Lo siento, Gema, pero esos pantalones ___ grandes.","answer":"te quedan"},{"id":"u55_3_11","sentence":"11. A ti ___ muy bien los sombreros, Amalia.","answer":"te sientan"},{"id":"u55_3_12","sentence":"12. \u2013\xbf___ a usted un gazpacho, Mat\xedas? \u2013No, gracias. ___ el est\xf3mago.","answer":"Le apetece, Me duele"}]}]}')}}]);